import React, {Component} from 'react'
import {Link} from 'react-router-dom'
import AuthenticationService from "./AuthenticationService.js"

class HeaderComponent extends Component {
    render() {
        const isUserLoggedIn = AuthenticationService.isUserLoggedIn()
        return (
            <header>
                <nav className="navbar navbar-expand-md navbar-dark bg-dark">
                    <div><a href="https://www.in28minutes.com" className="navbar-brand">in28Minutes</a></div>
                    <ul className="navbar-nav">
                        {AuthenticationService.isUserLoggedIn() &&
                        <li><Link className="nav-link" to="/Welcome/in28minutes">Home</Link></li>}
                        {AuthenticationService.isUserLoggedIn() &&
                        <li><Link className="nav-link" to="/todos">Todos</Link></li>}
                    </ul>
                    <ul className="navbar-nav navbar-collapse justify-content-end">
                        <li><Link className="nav-link" to="/login">Login</Link></li>
                        {AuthenticationService.isUserLoggedIn() && <li><Link className="nav-link" to="/logout"
                                   onClick={AuthenticationService.logout}>Logout</Link>
                        </li>}
                    </ul>
                </nav>
            </header>

        )
    }
}

export default HeaderComponent;
